CREATE TABLE contact_manager.address
(
    address_id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    contact_id int(11) NOT NULL,
    address_type varchar(20),
    address_line varchar(100),
    city varchar(20),
    state varchar(20),
    zip varchar(6),
    CONSTRAINT address_contact_contact_id_fk FOREIGN KEY (contact_id) REFERENCES contact_manager.contact (contact_id)
);
CREATE UNIQUE INDEX address_address_id_uindex ON contact_manager.address (address_id);
CREATE INDEX address_contact_contact_id_fk ON contact_manager.address (contact_id);
CREATE TABLE contact_manager.contact
(
    contact_id int(11) NOT NULL AUTO_INCREMENT,
    fname varchar(20) NOT NULL,
    mname varchar(20),
    lname varchar(20) NOT NULL
);
CREATE UNIQUE INDEX Contact_contact_id_uindex ON contact_manager.contact (contact_id);
CREATE TABLE contact_manager.date
(
    date_id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    contact_id int(11) NOT NULL,
    date_type varchar(20),
    date date,
    CONSTRAINT date_contact_contact_id_fk FOREIGN KEY (contact_id) REFERENCES contact_manager.contact (contact_id)
);
CREATE UNIQUE INDEX date_date_id_uindex ON contact_manager.date (date_id);
CREATE INDEX date_contact_contact_id_fk ON contact_manager.date (contact_id);
CREATE TABLE contact_manager.phone
(
    phone_id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    contact_id int(11) NOT NULL,
    phone_type varchar(20),
    area_code varchar(3),
    number varchar(8),
    CONSTRAINT phone_contact_contact_id_fk FOREIGN KEY (contact_id) REFERENCES contact_manager.contact (contact_id)
);
CREATE UNIQUE INDEX phone_phone_id_uindex ON contact_manager.phone (phone_id);
CREATE INDEX phone_contact_contact_id_fk ON contact_manager.phone (contact_id);
